      | 364873 -> { ItemTypeData.id= 364873; name= "Gallente Light Frame G/1-Series"; published= false; description= "A basic dropsuit frame hardwired with all minimum designation combat suites and protocols but without any role-specific customizations.    NOTE: This basic frame does not receive any role-specific bonuses."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365455 -> { ItemTypeData.id= 365455; name= "'Blisterrain' Six Kin Assault Combat Rifle"; published= false; description= "A gas-operated, short-barreled weapon, the combat rifle is a semi-automatic weapon well-suited to both short and medium range combat. Classified as a light support weapon, it is typically employed in target-rich environments where the high volume of fire produced enables operators to engage multiple targets in rapid succession, whilst the weapon’s extended range keeps the operator just beyond the threat threshold of most standard assault rifles.    Its advanced bullpup configuration reduces weapon weight and improves maneuverability making it the ideal cross-over weapon for urban and field combat. The modular design has more practical advantages as well in that it’s cheap to maintain and easily replaced if damaged, making it one of the most reliable weapons in service today."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365940 -> { ItemTypeData.id= 365940; name= "'Foxfour' Assault G-I"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.    Gallente forces have access to some of the most advanced armor systems in the cluster. An ablative-variant solution is used to dissipate energy across available surface area with only minimal degradation of the material at the impact point resulting in armor that is efficient and durable enough to maintain operational integrity for multiple short-term engagements. Augmented ferro-fibre musculature enhances the soldier’s strength, balance, and reaction time, while quad-opsis sensors allow wide arc identification and prioritization of battlefield targets.    Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366231 -> { ItemTypeData.id= 366231; name= "Faction Booster Amarr (15-Day)"; published= false; description= "Faction boosters are biometric identification chips issued by major factions throughout New Eden. Once activated they uniquely identify the user as a supporter of the issuing faction. Corporations operating on behalf of the faction will then be authorized to increase rewards to that individual."; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 366425 -> { ItemTypeData.id= 366425; name= "Imperial CRW-04 Scrambler Rifle"; published= false; description= "The scrambler rifle is a selective-fire weapon capable of semi-automatic and charged fire. Each shot produces a pulse of sinuous energy capable of penetrating shield and metal. By keeping pressure on the trigger, the operator can control the power of each discharge, scaling it to produce an intense pulse of energy fatal to soft targets.    The added power output does come with downsides, most notably increased heat build-up; left unmanaged, thermal stresses age the focusing crystal prematurely, resulting in splintering and potentially lethal feedback. Despite this and several other issues – increased heft, poor reliability, and high manufacturing cost – the scrambler rifle is widely available and in service on battlefields clusterwide."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
