      | 4324 -> { ItemTypeData.id= 4324; name= "Research Abstract: Project Huntress Green (1 of 3)"; published= true; description= "<b>Paper:</b> Project Huntress Green - The Nature of Life in Anoikis<br>  <b>Lead Researcher:</b> Gaia Ma'chello<br>  <b>Contributors:</b> James Arget, Tas Caern and Vincent Athena<br>  <b>Summary:</b> Examination of biological samples obtained from planets in Anoikis has shown that life there is closely related to that found in known sectors of space. Both use DNA as the genetic material, and both use the same 26 amino acids for building proteins. In addition, the genetic code (that is, which combinations of three nucleotides code for which amino acid) is the same for both humans and life in Anoikis. As the genetic code is arbitrary, the chance of this happening by accident is one in ten to the 26th power. We are forced to conclude that life in Anoikis and human life sprang from the same source.    Further investigation into how this could have come to be is the topic of another paper: <a href=showinfo:4336>The Origin of Life in Anoikis.</a>    <i>This abstract relates to research undertaken by the Arek'Jaalan Project.</i>    <i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>    <i>Further copies of this document can be obtained through the Arek'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>"; marketGroupId= None; groupId= 1141; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
